import React, { Component } from 'react'
import axios from 'axios';



class App extends Component {
  constructor(props) {
    super(props);

    this.state = {

      bookings:[]

    };
  }
componentDidMount(){


this.retrieveBookings();
}


retrieveBookings(){
  axios.get("http://localhost:8015/booking").then(res=>{

  if(res.data.success){
    this.setState({
      bookings:res.data.existingBookings
    });
    console.log(this.state.bookings);
  }
  });
}





  render() {
    return (
      <div>
        <p>Tour Guide Details Dashboard</p>

        <table class= "table">
          <thead class="thead-dark">
            <tr>
            <th scope="col">#</th>
            <th scope="col">Customer Name</th>
            <th scope="col">Customer Email</th>
            <th scope="col">Mobile No</th>
            <th scope="col">Tour Option</th>
            <th scope="col">Date</th>
            <th scope="col">Time</th>
            <th scope="col">Tour Guide </th>
            <th scope="col">Action</th>

            </tr>
          </thead>
          <tbody>
            {this.state.bookings.map((booking,index)=>(
              <tr>
                <th scope="row">{index+1}</th>
                <td>{booking.CustomerName}</td>
                <td>{booking.CustomerEmail}</td>
                <td>{booking.MobileNumber}</td>
                <td>{booking.TourOption}</td>
                <td>{booking.Date}</td>
                <td>{booking.Time} </td>
                <td>{booking.TourGuideName}</td>
                <td>
                  <a className="btn btn-warning" hred="#">
                    <i className="fas fa-edit"></i> &nbsp; Edit
                  </a>
                  &nbsp; &nbsp;
                  <a className="btn btn-danger" hred="#">
                    <i className="far fa-trash"></i> &nbsp; Delete
                  </a>

                </td>

              </tr>

            ))}





          </tbody>



        </table>







      </div>
    )
  }
}

export default App
